import React from 'react'

const SIZES = {
    over: 'workimg--oversize',
    max: 'workimg--maxsize',
    card: 'workimg--cardsize'
};

const blank = null;

function WorkImg({src, size}) {
    const imgSize = SIZES[size];

    if(size==='over'){
        blank = <div className="blank"></div>;
    }
    return (
        <>
        <img className={imgSize} src={src} alt="Work Image" />
        </>
    )
}

export default WorkImg;
